import { Link } from "react-router-dom"
import "./Navbar.css"
function NavBar() {

    return (
        <nav>
            <ul>
                <li> <Link to="/"> Home </Link> </li>
                <li> <Link to="/contact"> Contacto </Link></li>
            </ul>
        </nav>
    )
}
export default NavBar
